import React from 'react';

const FieldsViewer=(props)=>{
    return(
        <div>
           <label>{props.label}:</label>
           <input
                type={props.type}
                onChange={this.props.handleChange}>          
           </input>
        </div>
    );
        
    

}

export default FieldsViewer;
